
SELECT COUNT(*) as agg_0 FROM "corporation" LEFT OUTER JOIN "region" ON "corporation"."region_no" = "region"."region_no" LEFT OUTER JOIN "provider" ON "region"."region_no" = "provider"."region_no" LEFT OUTER JOIN "member" ON "region"."region_no" = "member"."region_no" LEFT OUTER JOIN "statement" ON "member"."member_no" = "statement"."member_no" LEFT OUTER JOIN "payment" ON "member"."member_no" = "payment"."member_no"  WHERE "statement"."due_dt" = '%1999-10-03 00:00:00%' AND "provider"."expr_dt" != '%2000-10-12 10:41:19%' AND "region"."street" LIKE '%S%t%' AND "payment"."member_no" IS NOT NULL;